import React from 'react';
import { DocumentTextIcon, VideoCameraIcon, MusicalNoteIcon } from '@heroicons/react/24/outline';

const Content = () => {
  const contentItems = [
    {
      id: 1,
      title: 'Introduction Video',
      type: 'video',
      icon: VideoCameraIcon,
      size: '256 MB',
      lastModified: '2 hours ago',
      views: 1234
    },
    {
      id: 2,
      title: 'Latest Track Release',
      type: 'audio',
      icon: MusicalNoteIcon,
      size: '128 MB',
      lastModified: '4 hours ago',
      plays: 5678
    },
    {
      id: 3,
      title: 'Project Documentation',
      type: 'document',
      icon: DocumentTextIcon,
      size: '2.5 MB',
      lastModified: '1 day ago',
      downloads: 890
    }
  ];

  const getMetricLabel = (type, value) => {
    switch (type) {
      case 'video':
        return `${value.toLocaleString()} views`;
      case 'audio':
        return `${value.toLocaleString()} plays`;
      case 'document':
        return `${value.toLocaleString()} downloads`;
      default:
        return '';
    }
  };

  return (
    <div className="flex-1 overflow-y-auto bg-secondary-50">
      <div className="max-w-7xl mx-auto py-8 px-4 sm:px-6 lg:px-8">
        <div className="bg-white rounded-lg shadow-sm">
          <div className="px-6 py-4 border-b border-secondary-200">
            <h1 className="text-2xl font-bold text-secondary-900">Content Collection</h1>
            <p className="text-secondary-500">Manage and view all your content in one place</p>
          </div>

          <div className="p-6">
            <div className="grid grid-cols-1 gap-6 sm:grid-cols-2 lg:grid-cols-3">
              {contentItems.map((item) => (
                <div
                  key={item.id}
                  className="bg-white border border-secondary-200 rounded-lg shadow-sm hover:shadow-md transition-shadow duration-200"
                >
                  <div className="p-6">
                    <div className="flex items-center justify-between mb-4">
                      <div className="p-2 bg-secondary-100 rounded-lg">
                        <item.icon className="h-6 w-6 text-secondary-600" />
                      </div>
                      <span className="text-xs text-secondary-500">{item.size}</span>
                    </div>
                    <h3 className="text-lg font-medium text-secondary-900 mb-1">{item.title}</h3>
                    <p className="text-sm text-secondary-500 mb-4">Last modified {item.lastModified}</p>
                    <div className="flex items-center justify-between">
                      <span className="text-sm text-secondary-600">
                        {getMetricLabel(item.type, item.views || item.plays || item.downloads)}
                      </span>
                      <button className="text-primary-600 hover:text-primary-700 text-sm font-medium">
                        View Details
                      </button>
                    </div>
                  </div>
                </div>
              ))}
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Content;
